int hex2dec(char *hex)
{
  int result = 0, len, i;
	
  len = strlen(hex);
  
  for (i=0; i < len; i++)
    if (isxdigit(hex[i]))
      {
	result <<= 4;
	if ((hex[i] >= '0') && (hex[i] <= '9'))
	  result += hex[i] - '0';
	else if ((hex[i] >= 'A') && (hex[i] <= 'F'))
	  result += hex[i] - 'A' + 10;
	else if ((hex[i] >= 'a') && (hex[i] <= 'f'))
	  result += hex[i] - 'a' + 10;
	else
	  FATAL(("isxdigit() returned true on '%c', not a hex digit", hex[i]));
      }
  return result;
}

